summary:
Very simple package with just one very simple command. Run a MSDOS command and return the output as a string, just as you would get from command line, but in C# code.

Dos.CommandLine.Execute("echo hello world");

This returns "hello world".

description:
An easy to use exchange-rate checker. Providers include Google, Rate-Exchange and Yahoo.

Usage - 
Provider.Google.Rate(Iso4217.GBP, Iso4217.USD);
Provider.Yahoo.Rate("GBP", "EUR");

